import { useEffect, useState } from "react";
import { getRoadmaps } from "../api/api";

export default function Roadmap() {
  const [data, setData] = useState([]);

  useEffect(() => { getRoadmaps().then(setData); }, []);

  return (
    <>
      <h2>Roadmap</h2>
      <table className="enterprise-table">
        <thead>
          <tr><th>Program</th><th>Quarter</th><th>Milestone</th><th>Status</th></tr>
        </thead>
        <tbody>
          {data.map(r => (
            <tr key={r.id}>
              <td>{r.programId}</td>
              <td>{r.quarter}</td>
              <td>{r.milestone}</td>
              <td>{r.readiness}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </>
  );
}
